CREATE TABLE IF NOT EXISTS templates (
  id INT GENERATED BY DEFAULT AS IDENTITY (START WITH 200 INCREMENT BY 1),
  template_family_id VARCHAR(255) DEFAULT NULL,
  template_name VARCHAR(255) DEFAULT NULL,
  templateurl VARCHAR(255) DEFAULT NULL,
  template_status VARCHAR(255) DEFAULT NULL,
  template_guide VARCHAR(255) DEFAULT NULL,
  description VARCHAR(255) DEFAULT NULL,
  imageurl VARCHAR(255) DEFAULT NULL,
  PRIMARY KEY (id)
);


INSERT INTO templates 
  (id, template_family_id, template_name, templateurl, template_status, template_guide, description, imageurl) 
VALUES 
  (1,'5093f261e4b0979eac7cb299','Adirondack','http://adirondack-demo.squarespace.com/','','','Designed to elevate brands large and small, Adirondack is the perfect template for self-starters and savvy entrepreneurs. Its minimal navigation and full header images provide a bold framework for your vision.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/adirondack-demo-squarespace-com--1689x1080-500w.jpg?1'),(2,'515c7bd0e4b054dae3fcf003','Adversary','http://adversary-demo.squarespace.com/','discontinued',NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/adversary-demo-squarespace-com--1689x1080-500w.jpg?1'),(3,'515c7bd0e4b054dae3fcf003','Alex','http://alex-demo.squarespace.com/','discontinued',NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/alex-demo-squarespace-com--1689x1080-500w.jpg?1'),(4,'52a74dafe4b073a80cd253c5','Anya','http://anya-demo.squarespace.com/','','','Anya makes capturing the spirit of your engagement fun and easy. Its intuitive interface and beautiful features make it an ideal template for telling the story of your time together.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/anya-demo-squarespace-com--1689x1080-500w.jpg?1'),(5,'507c1fdf84ae362b5e7be44e','Aubrey','http://aubrey-demo.squarespace.com/','','','Aubrey prominently displays your favorite photos by utilizing a unique front-and-center design that puts your occasion’s most important details where they can’t be missed.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/aubrey-demo-squarespace-com--1689x1080-500w.jpg?1'),(6,'4fd11f32c4aad9b01c9e624c','Avenue','http://avenue-demo.squarespace.com/','','','A classic template with a timeless look, Avenue’s clean, straight lines and adaptive grid-based layout are especially popular with photographers, illustrators and designers.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/avenue-demo-squarespace-com--1689x1080-500w.jpg?1'),(7,'507c1fdf84ae362b5e7be44e','Aviator','http://aviator-demo.squarespace.com/','','','Take your business to new heights with Aviator. Use this template’s content overlay system to put your business’s vital info where it can’t be missed, then easily customize the beautiful full screen background image with just a few clicks.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/aviator-demo-squarespace-com--1689x1080-500w.jpg?1'),(8,'52a74dafe4b073a80cd253c5','Bedford','http://bedford-demo.squarespace.com/','','','One of our most popular templates, Bedford offers a wide range of features specifically for non-profits and small businesses. Although its beautiful interface and countless features make it an ideal template for almost anything.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/bedford-demo-squarespace-com--1689x1080-500w.jpg?1'),(9,'4fdf4f21c4aad4a72790bd9b','Boutique','http://boutique-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/boutique-demo-squarespace-com--1689x1080-500w.jpg?1'),(10,'52a74dafe4b073a80cd253c5','Bryant','http://bryant-demo.squarespace.com/','','','Bryant was designed with real estate in mind. Whether you''re selling a single lot or the entire neighborhood, Bryant''s bold thumbnail galleries and customizable features lists help you make the sale.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/bryant-demo-squarespace-com--1689x1080-500w.jpg?1'),(11,'52e96934e4b0ea14d0f64568','Charlotte','http://charlotte-demo.squarespace.com/','','','Show your love to the world. Charlotte is an easy to use template for fun-loving couples that tells your story with beautiful photo galleries, a full-screen header image, and scroll-based navigation.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/charlotte-demo-squarespace-com--1689x1080-500w.jpg?1'),(12,'50996af1e4b0d2694881a49d','Devlin','http://devlin-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/devlin-demo-squarespace-com--1689x1080-500w.jpg?1'),(13,'4fef25bbe4b0ea9df05ac51e','DoveTail','http://dovetail-demo.squarespace.com/','discontinued',NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/dovetail-demo-squarespace-com--1689x1080-500w.jpg?1'),(14,'507c1fdf84ae362b5e7be44e','Encore','http://encore-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/encore-demo-squarespace-com--1689x1080-500w.jpg?1'),(15,'503ba86de4b04953d0f49846','Five','http://five-demo.squarespace.com/','','','Five is a clean, professional template that’s easy to set up. It''s also preferred by small and mid-sized businesses for its dynamic layout and numerous customization options.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/five-demo-squarespace-com--1689x1080-500w.jpg?1'),(16,'4fba57fde4b0f79d428daa8b','FlatIron','http://flatiron-demo.squarespace.com/','','','Like the iconic Manhattan building, Flatiron is unconventional. With a portfolio experience that supports multiple portfolio projects side by side, Flatiron is popular with art directors, illustrators, and photographers.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/flatiron-demo-squarespace-com--1689x1080-500w.jpg?1'),(17,'51e6b9e4e4b062dafa7099b9','Forte','http://forte-demo.squarespace.com/','','','Forte is a bold yet minimal template that features full-screen images and precise typography. Its landing page pulls visitors into your portfolio, showcasing the range of projects for your restaurant, portfolio, or business in beautiful high-resolution.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/forte-demo-squarespace-com--1689x1080-500w.jpg?1'),(18,'4fb6ba24e4b000ba644d8298','Front Row','http://frontrow-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/front row-demo-squarespace-com--1689x1080-500w.jpg?1'),(19,'52e96934e4b0ea14d0f64568','Fulton','http://fulton-demo.squarespace.com/','','','Fulton is for craftsmen seeking a competitive edge for their eCommerce website. With large galleries and striking headlines, Fulton is for creators and craftsmen.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/fulton-demo-squarespace-com--1689x1080-500w.jpg?1'),(20,'5230da18e4b0a637f7e627c5','Galapagos','http://galapagos-demo.squarespace.com/','','','With automated grid layouts and hover-activated image swapping, Galapagos makes it easy for your customers to find more of what they’re looking for. For the coolest shop around, try Galapagos.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/galapagos-demo-squarespace-com--1689x1080-500w.jpg?1'),(21,'52a74dafe4b073a80cd253c5','Hayden','http://hayden-demo.squarespace.com/','','','Hayden is a contemporary design favored by small and mid-sized businesses with a chic aesthetic and a modern sensibility.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/hayden-demo-squarespace-com--1689x1080-500w.jpg?1'),(22,'52e96934e4b0ea14d0f64568','Horizon','http://horizon-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/horizon-demo-squarespace-com--1689x1080-500w.jpg?1'),(23,'4fb7a14224ac99c5fee12515','Ishimoto','http://ishimoto-demo.squarespace.com/','','','A one-of-a-kind template with a one-of-a-kind name. Ishimoto is a portfolio template with an innovative, horizontal gallery slider that makes it preferred among photographers, artists, and restaurants.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/ishimoto-demo-squarespace-com--1689x1080-500w.jpg?1'),(24,'50521cf884aeb45fa5cfdb80','Julia','http://julia-demo.squarespace.com/','','','Regardless of when you tie the knot, Julia is a perfect template to help you announce and plan your big day. Its flexibility, clean layout and simple style combine to make this one of our most elegant templates.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/julia-demo-squarespace-com--1689x1080-500w.jpg?1'),(25,'515c7bd0e4b054dae3fcf003','Marquee','https://marquee-demo.squarespace.com/','discontinued',NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/marquee-demo-squarespace-com--1689x1080-500w.jpg?1'),(26,'50130f5be4b00a22f5c5a82a','Momentum','http://momentum-demo.squarespace.com/','','','Momentum is a beautiful template built especially for photographers and designers who need fullscreens, high resolutions, and the ability to show work in a slideshow interface.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/momentum-demo-squarespace-com--1689x1080-500w.jpg?1'),(27,'50521cf884aeb45fa5cfdb80','Montauk','http://montauk-demo.squarespace.com/','','','Montauk is a polished business template that’s easy to set up and easier to customize. Montauk is valued by independent businesses for its flexibility, clean layouts, and professional style.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/montauk-demo-squarespace-com--1689x1080-500w.jpg?1'),(28,'52e96934e4b0ea14d0f64568','Naomi','http://naomi-demo.squarespace.com/','','','When you want to make the most of your moments, choose Naomi to display engagement photos and the details of your occasion with long, scrolling pages and beautiful interactive elements.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/naomi-demo-squarespace-com--1689x1080-500w.jpg?1'),(29,'4f6a1392e4b07090d46e7ec9','Native','http://native-demo.squarespace.com/','','','Preferred by businesses and bloggers, Native is a versatile and modern template. The Native blog layout adapts to its content, promoting your most interesting media.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/native-demo-squarespace-com--1689x1080-500w.jpg?1'),(30,'50521cf884aeb45fa5cfdb80','Om','http://om-demo.squarespace.com/','','','Om is a calm, cool template that elevates your content by utilizing a clean layout and a simple, open interface. Om is at one with your content.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/om-demo-squarespace-com--1689x1080-500w.jpg?1'),(31,'52e96934e4b0ea14d0f64568','Pacific','http://pacific-demo.squarespace.com/','','','Perfect for agencies, restaurants, bands, wedding sites, and more. Pacific allows you to create long scrolling pages with background images and beautiful full-width galleries or albums.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/pacific-demo-squarespace-com--1689x1080-500w.jpg?1'),(32,'500589fc84aed5ec11c2b672','Peak','http://peak-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/peak-demo-squarespace-com--1689x1080-500w.jpg?1'),(33,'515c7bd0e4b054dae3fcf003','Shift','http://shift-demo.squarespace.com/',NULL,NULL,NULL,'https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/shift-demo-squarespace-com--1689x1080-500w.jpg?1'),(34,'5253022fe4b0d0363260861e','Supply','http://supply-demo.squarespace.com/','','','Where there’s Supply, there’s demand. Supply is a beautiful template that presents your store or portfolio in a way that is engaging and easy to navigate, letting visitors experience your products in a big way.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/supply-demo-squarespace-com--1689x1080-500w.jpg?1'),(35,'4f9adc1524ac5df956fdf98f','Wells','http://wells-demo.squarespace.com/','','','Wells is popular with artists, photographers, and businesses that value simple yet elegant design.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/wells-demo-squarespace-com--1689x1080-500w.jpg?1'),(36,'4fbff70b84aeca67fb3a3c56','Wexley','http://wexley-demo.squarespace.com/','','','Wexley’s gallery layout adapts to the size of the images in your visual portfolio and to screen widths, making it perfect for artists, creative professionals and photographers who need a dynamic way to showcase everything.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/wexley-demo-squarespace-com--1689x1080-500w.jpg?1'),(37,'55dccafee4b04b8e0d7b6d4d','Artesia','http://artesia-demo.squarespace.com/','','','Get customers in the door with Artesia. Its immersive landing page features clickable banners that take visitors deeper into your website by connecting them to other pages. Text and image animations, like fade-in and scroll-activated slide-up effects...','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/artesia-demo-squarespace-com--1689x1080-500w.jpg?1'),(38,'55f0aac0e4b0f0a5b7e0b22e','Aria','https://aria-demo.squarespace.com/','released June 2017',NULL,'Aria’s cool, composed layout sets the stage for musicians hoping to showcase their work, promote an album, or captivate new audiences. Video Backgrounds add a dynamic layer to any website, creating an immersive experience... ','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/aria-demo-squarespace-com--1689x1080-500w.jpg?1'),(39,'56d9c12107eaa07660adbcad','Camino','http://camino-demo.squarespace.com/','released June 2017',NULL,'Treat yourself to luxurious design with a sophisticated template like Camino. Sleek scrolling effects and full-screen image displays give your brand or business the royal treatment by putting your site’s message front and center...','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/camino-demo-squarespace-com--1689x1080-500w.jpg?1'),(40,'55f0aac0e4b0f0a5b7e0b22e','Maple','https://maple-demo.squarespace.com/','released June 2017',NULL,'Maple lets you introduce your local business to a global audience while staying true to your brand. This minimalist, yet versatile, design makes a big impact on site visitors the moment they load the page...','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/maple-demo-squarespace-com--1689x1080-500w.jpg?1'),(41,'55f0aac0e4b0f0a5b7e0b22e','Cacao','http://cacao-demo.squarespace.com/','released June 2017',NULL,'Whether you’re setting up shop for the first time or looking to boost sales, Cacao’s eye-catching design creates a rich, one-of-a-kind shopping experience. Merchandising your online store has never been easier than it is with this bold new layout...','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/cacao-demo-squarespace-com--1689x1080-500w.jpg?1'),(42,'55f0aac0e4b0f0a5b7e0b22e','Kin','http://kin-demo.squarespace.com/','released Dec 2017',NULL,'Share joyful greetings with friends and family with Kin. This charming newsletter layout mixes different image styles, overlays, and text to capture your year''s most exciting events. Great for holiday cards and other announcements.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/kin-demo-squarespace-com--1689x1080-500w.jpg?1'),(43,'55f0aac0e4b0f0a5b7e0b22e','Royce','http://royce-demo.squarespace.com/','released Dec 2017',NULL,'Celebrate good times with Royce. Simple and bold, this invitation template gives guests the information they need and gets them hyped for the big event. An excellent choice for parties, weddings, and other festivities.','https://static1.squarespace.com/static/ta/5134cbefe4b0c6fb04df8065/9266/assets/pages/template-picker-2016/screenshots/royce-demo-squarespace-com--1689x1080-500w.jpg?1'),(44,'55f0aac0e4b0f0a5b7e0b22e','Stella','http://stella-demo.squarespace.com/','released Dec 2017',NULL,'Lively colors and dramatic text get people pumped and ready for action. Fitness professionals and other specialists use Stella to entice new clients and encourage them to schedule appointments.','https://static1.squarespace.com/stat